function centerOfMass(arr) {    
	h = arr.height;
	w = arr.width;
	var M = 0, Mx = 0, My = 0;
	for (var i = 0; i < h; i++) {
		for (var j = 0; j < w; j++) {
			index = (i * w + j) * 4;
			Mx += arr.data[index] * j;
			My += arr.data[index] * i;
			M += arr.data[index];
		}
	}
    return [Mx / M, My / M];
}